import React from 'react';
import './Result.css'; // Не забудьте создать этот CSS файл!
import logo from './logo.png'; // Импортируйте ваш логотип
import { useNavigate } from 'react-router-dom';

const Result = () => {
    const navigate = useNavigate();

    const handleButtonClick = () => {
        navigate('/path-to-your-next-page'); // Укажите нужный путь
    };

    return (
        <div className="result-container">
            <div className="header">
                <img src={logo} alt="Логотип" className="logo" />
            </div>
            <button className="rating-button" onClick={handleButtonClick}>
                Сформировать отчет
            </button>
        </div>
    );
};

export default Result;
